import React from 'react'
import styles from './styles.module.css'

function Event({eventData}) {
  return (
    <div className={styles.event}>
        <div>
            
            </div>
            <div className={styles.eventDescription}>
            {eventData.desc}
        </div>
    </div>
  )
}

export default Event
